### Initialize Session
In your app's initial activity, override the start method as shown below.  If the initialization fails, additional debugging information can be logged by adding "branch.setDebug()" before the call to initSession.

If you created a custom link with your own custom dictionary data, you probably want to know when the user session init finishes, so you can check that data. Think of this callback as your "deep link router". If your app opens with some data, you want to route the user depending on the data you passed in. Otherwise, send them to a generic install flow.

This deep link routing callback is called every time the app opens, returning your deep link data or an empty dictionary if none are present.

```java
@Override
public void onStart() {
	super.onStart();

	// Your app key can be retrieved on the [Settings](https://dashboard.branch.io/#/settings) page of the dashboard
	Branch branch = Branch.getInstance(getApplicationContext());
	// branch.setDebug(); // Uncomment to enable additional logging
	branch.initSession(new BranchReferralInitListener(){
		@Override
		public void onInitFinished(JSONObject referringParams, BranchError error) {
			if (error == null) {
				// params are the deep linked params associated with the link that the user clicked before showing up
				// params will be empty if no data found

				// here is the data from the example below if a new user clicked on Joe's link and installed the app
				String name = referringParams.getString("user"); // returns Joe
				String profileUrl = referringParams.getString("profile_pic"); // returns https://s3-us-west-1.amazonaws.com/myapp/joes_pic.jpg
				String description = referringParams.getString("description"); // returns Joe likes long walks on the beach...

				// route to a profile page in the app for Joe
				// show a customer welcome
			} else {
				Log.i("MyApp", error.getMessage());
			}
		}
	}, this.getIntent().getData(), this);
}
```

### Close Session
This call will clear the deep link parameters when the app is closed, so they can be refreshed after a new link is clicked or the app is reopened.

```java
    @Override
    public void onStop() {
        super.onStop();
        Branch.getInstance(getApplicationContext()).closeSession();
